	const response = await fetch("http://localhost:3001/add", {
        method: 'POST',
		mode: 'cors',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
			_IP: "127.0.0.1",
			_Name: "Server1",
			_TypeName: "t1.micro",
			_TypePPM: 1,
		})
	});
	const data = await response.json();
	console.log(data);

